import React from "react";

function OrderList(){
    return (
        <ol>
        <li>Stranger Things</li>
        <li>Money Heist</li>
        <li>Rise of the Ottoman</li>
        <li>Vikings</li>
        <li>Friends</li>
        </ol>
    );
}
export default OrderList;
